import React from "react";
const MyAcccord = ((props)=>{
    return (<>
        <div className="main">

        <div className="main-heading"></div>
        <p> ⚔️Interview Questions</p>

        {props.id+1}.{props.question}
        : {props.answer}
        
        </div>
    </>)

})
export  default MyAcccord
